subSubSection.paragraph:
Male terminalia
. Apex of ventral median lobe pointed and apex of dorsal median lobe rounded; ventral lobe shorter than dorsal lobe; spined region of internal sac much longer than basal unspined region; spined region divided into two sections without unspined gap between sections: first section with mixture of dense large and long simple spines, fairly dense multi-branched spines and dense scale-like processes; second section with dense long simple spine and fairly dense short simple spines (
Fig. 69a
). Eighth sternite obliquely truncate or slightly rounded at sides; apex emarginate, with fairly dense setae arising terminally; ventral surface with sparse short simple spines and cloud-like processes (
Fig. 69b
). Eighth tergite almost truncate at sides, slightly emarginate at apex with long and short setae; mid area with dense simple spines and multibranched spine (
Fig. 69c
). Paramere 2 × as long as wide, cylindrical in shape, apex rounded with long dense setae (
Fig. 69d
).

Ovipositor and spermatheca.
Ovipositor relatively long; styli relatively large, arising terminally with short hairs (
Fig. 69e
). Spermatheca slightly curved; spermathecal gland arising at basal 1/3 (
Fig. 69f
).
